class Slider {


  constructor() {

    this.slides = [
      {'title': 'Разместите','text': ''},
      {'title': '','text': ''},
      {'title': '','text': ''}
    ]
    this.sliderId = -1;
    this.animating = false;
    this.btn = document.querySelector(".js-slide-next");

    this.btn.addEventListener('click', ()=>{
      this.nextSlide();
    });

    let video = document.querySelector('.js-video-slider');
    video.addEventListener('timeupdate', (event) => {
      let currentTime = video.currentTime;
      var watchPoint = Math.floor((currentTime/video.duration) * 100);

      this.btnAnimation = this.btn.querySelector("lottie-player");
      if(watchPoint) {
        this.btnAnimation.seek(watchPoint+'%');
      }


    });


    this.nextSlide();
  }

  nextSlide(){

    if(this.animating) {
      return false;
    }

    this.animating = true;
    var txts=document.querySelector(".slider-area__texts").children,
        nums = document.querySelector(".slider-area__number__sliders").children,
        txtsLen=txts.length;

    var oldSliderId = this.sliderId;
    if(this.sliderId == txtsLen-1){
      this.sliderId=0;
    }
    else {
      this.sliderId++;
    }

    console.log(this.sliderId);

    var Timer=1000;



    if(oldSliderId > -1) {
      txts[oldSliderId].classList.add("text-out");
      txts[oldSliderId].classList.remove("text-in");

      nums[oldSliderId].classList.add("text-out");
      nums[oldSliderId].classList.remove("text-in");
      setTimeout(()=>{
        txts[oldSliderId].classList.remove("text-out");
        nums[oldSliderId].classList.remove("text-out");
        this.animating = false;
      }, Timer)





    } else {
      setTimeout(()=>{
        this.animating = false;
      }, Timer)
    }

    var video = document.querySelector('.js-video-slider');
    var sources = video.getElementsByTagName('source');
    sources[0].src = './video/'+(this.sliderId+1)+'.mp4';
    video.load();


    txts[this.sliderId].classList.add("text-in");
    nums[this.sliderId].classList.add("text-in");

    this.btnAnimation = this.btn.querySelector("lottie-player");
    this.btnAnimation.load(
        configLotti[this.sliderId]
    );
  }
}

document.addEventListener('DOMContentLoaded', function(){

  var playerWrap = document.querySelector(".sec-who");
  var  players = playerWrap.querySelectorAll("lottie-player");
  players.forEach((el)=>{
    var icon = el.getAttribute('data-icon-type');
    console.log(configLotti[icon])
    el.load(
        configLotti[icon]
    );
    var directionMenu = 1;

    el.parentNode.addEventListener("mouseover", ()=>{
      el.setDirection(directionMenu);
      el.play();
    }, false);
    el.parentNode.addEventListener("mouseout", ()=>{
      el.setDirection(-directionMenu);
      el.play();
    }, false);
  });



  new Slider();
});

